import React, { Component } from 'react';

// Set Up The Initial Context
export const AppContext = React.createContext(
  {jsondata:'default data from app context'}
  );


class AppContextProvider extends Component {
      // state = {
      //   jsondata:{"test":{"name":"testing json"}}
      // }

      render() {
        return (
            <AppContext.Provider value='I am the new value from cotext'>
             {this.props.children}
            </AppContext.Provider>
          );
        }
      }

export default AppContextProvider;
